const Modal = ({ onSetModal }) => {
  return (
    <div className='modal-box' onClick={onSetModal(false)}>
      <p>The inputs must not be empty!</p>
      <button
        onClick={() => {
          onSetModal(false);
        }}
      >
        Close
      </button>
    </div>
  );
};

export default Modal;
